import React from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";

const LayoutAuthentication = (props) => {
  const { children, heading } = props;
  return (
    <div className="w-full min-h-screen p-10 bg-lite relative isolate">
      <img
        src="/ellipse.png"
        alt="bg"
        className="pointer-events-none absolute bottom-0 left-0 right-0 z-[-1]"
      />
      <Link to="/" className="inline-block mb-5 lg:mb-16">
        <img srcSet="/logo.png 2x" alt="crowfunding" />
      </Link>
      <div className="w-full max-w-[556px] bg-white rounded-xl px-5 py-8 lg:px-16 lg:py-12 mx-auto">
        <h1 className="text-lg font-semibold lg:text-xl mb-1 lg:mb-3 text-text1 text-center">
          {heading}{" "}
        </h1>
        {children}
      </div>
    </div>
  );
};
LayoutAuthentication.propTypes = {

}

export default LayoutAuthentication;
